--
-- Structure de la table `post`
--

CREATE TABLE `post` (
  `id` int(11) NOT NULL,
  `name` varchar(140) COLLATE utf8mb4_unicode_ci NOT NULL,
  `description` varchar(1000) COLLATE utf8mb4_unicode_ci NOT NULL,
  `group_figure` varchar(550) COLLATE utf8mb4_unicode_ci NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

--
-- Déchargement des données de la table `post`
--

INSERT INTO `post` (`id`, `name`, `description`, `group_figure`) VALUES
(3, 'Le Ollie', 'Le Ollie est le trick fondamental qui donne accès à toutes les autres figures en snowboard. C\'est la clé pour découvrir le freestyle. \r\n\r\nIl est simple à faire mais difficile à perfectionner, alors étudions-le en détail. Le Ollie permet de faire décoller la planche du sol. Il nécessite quatre étapes : charger la planche en énergie, basculer le poids vers l\'arrière, faire décoller la spatule arrière (Tail), puis pousser sur la spatule avant (Nose) pour stabiliser la planche. Maîtrise-le bien et tu accéderas au monde merveilleux du freestyle.', 'Figure Butter'),
(4, 'Le Tail Press', 'Le Tail Press est initié en déplaçant ton poids vers l\'arrière de ta planche tout en restant droit et en soulevant le Nose de la neige.', 'Figure Butter'),
(5, 'Le Tripod', 'Va en ligne droite et regarde derrière toi. Fais une grosse pression sur le talon de la planche, puis baisse-toi et touche la neige avec tes mains, en formant un trépied avec le talon de la planche et tes bras. Cette figure demande beaucoup de force au niveau des abdominaux pour tenir en trépied.', 'Figure Butter'),
(6, 'Le Nose-Roll 180', 'Amorce un virage sur les orteils ou les talons, et une fois que tu es sur la carre, soulève le talon de ta planche, en gardant la spatule au sol. Ensuite, fais pivoter la planche pour atterrir en Switch.', 'Figure Butter'),
(7, 'Le Tail-Drag 180', 'Le Tail drag consiste à amorcer un virage appuyé sur tes orteils ou tes talons, puis à faire un Ollie mais en gardant le talon de la planche au sol. Ensuite, fais-le glisser et atterris en Switch.', 'Figure Butter'),
(8, 'Le Indy', 'Attrape le carre des orteils de ta planche, entre les fixations, avec ta main arrière.', 'Figure Grabs'),
(9, 'Le Stalefish', 'Passe la main derrière ton genou arrière et attrape le carre de ta planche entre les fixations, côté talon, avec ta main arrière.', 'Figure Grabs'),
(10, 'Le Melon', 'Passe la main avant derrière ton genou et attrape le bord des talons entre les fixations.', 'Figure Grabs'),
(11, 'Le Method', 'À partir de la prise du Melon, étends tes jambes de façon à ce que ton corps ait presque la forme de la queue d\'un scorpion, puis cherche à atteindre le ciel avec ta main arrière. C\'est la figure la plus stylée, et chacun a sa propre version.', 'Figure Grabs'),
(12, 'Le Wildcat', 'Un Wildcat est un Backflip qui garde la planche parallèle à la trajectoire, tu fais donc une sorte de Flip \"latéral\" sans perte de vitesse.', 'Figure Flips'),
(13, 'Le Backflip', 'Un Backflip fait tourner la planche perpendiculairement à la neige, tu fais donc un Flip directement en arrière, en stabilisant la planche lors de l\'atterrissage.', 'Figure Flips'),
(14, 'Le Rodéo', 'Un Rodéo est un Frontflip avec un twist. Littéralement. Lorsque tu arrives sur le rebord du saut, déclenche un virage Frontside. Puis, décolle la carre des orteils de ta planche, en continuant la rotation, de façon à effectuer un Frontflip avec un Frontside 180, puis atterris en Switch.', 'Figure Flips'),
(15, 'Le 50-50', 'Il s\'agit de chevaucher un rail ou un box avec ta planche en ligne droite sur la structure.', 'Figure Slide'),
(16, 'Le Frontside Boardslide', 'Il s\'agit de glisser jusqu\'au rail sur ton côté arrière, puis de sauter dessus avec le nez de la planche au-dessus du rail. Tu atterris avec le rail entre tes fixations, ta planche perpendiculaire à la structure.', 'Figure Slide'),
(17, 'Le Backside Boardslide', 'Approche le rail sur ton côté avant et saute avec la spatule avant au-dessus du rail. Le rail se place entre tes fixations, mais avec ton talon en tête, c\'est-à-dire en glissant sur la structure vers l\'arrière.', 'Figure Slide'),
(18, 'Le Frontside Lipslide', 'Identique au Frontside Boardslide, mais tu te diriges vers le rail en le positionnant sur ton côté avant. Tu sautes ensuite avec le talon de la planche au-dessus du rail et tu atterris dessus avec le rail entre tes fixations.', 'Figure Slide'),
(19, 'Le Backside Lipslide', 'Même principe que le Backside Boardslide, mais tu montes sur le rail par l\'arrière et tu passes le talon de la planche par-dessus le rail pour le positionner entre tes fixations. Tu fais cela avec tes talons vers l\'avant.', 'Figure Slide'),
(21, 'Le Bluntslide', 'Un Bluntslide signifie que le rail se trouve sous l\'une de tes fixations au lieu d\'être au milieu de la planche. Tu verras souvent cela comme un Boardslide Frontside Blunt, ou un Lipslide Backside Blunt, selon la façon dont tu es arrivé sur le rail et la direction dans laquelle tu vas.', 'Figure Slide'),
(22, 'Le Tamedog', 'L\'exact opposé d\'un Wildcat est un Tamedog. C\'est un Frontflip qui garde la planche parallèle à la trajectoire. Un hard Nollie utilise le nez comme tremplin pour amorcer la rotation.', 'Figure Flips'),
(23, 'Le Frontflip', 'Tout comme le Tamedog, le Frontflip te demande de faire un Nose-Press et un Nollie sur un bord. Tu tends ensuite les deux mains vers l\'avant pour amorcer le saut périlleux et remettre la planche en place pour l\'atterrissage.', 'Figure Flips'),
(24, 'Le Backside Rodéo', 'L\'inverse du Rodéo, le Backside Rodéo consiste à amorcer un virage Backside à partir du saut, à décoller la carre du talon, puis à effectuer un Backflip avec un Switch 180 à l\'atterrissage. On peut ajouter plus de rotation pour en faire un Backside Rodéo 540, par exemple - un favori des pros pour son incroyable style !', 'Figure Flips'),
(25, 'Le Corked Spin', 'Un Corked Spin ajoute simplement un front ou un Backflip dans un flat spin. Tu l\'entendras généralement en compétition lorsque les pros lancent des Back Double Corked 10s ou des Cabs Triple Cork 14s. Mais n\'importe quel spin peut être \"corké\", comme les Rodéos ci-dessus.', 'Figure Flips'),
(26, 'Le Nose Press', 'C\'est l’opposé du Tail Press. Le Nose Press exige que ton poids soit sur l\'avant de la planche, avec l\'arrière décollé de la neige.', 'Figure Butter'),
(27, 'Le Nose-Roll 360', 'Commence de la même manière que le Nose-Roll 180, mais saute plus haut et avec plus de force au niveau de la rotation. Lorsque ta planche est perpendiculaire à la trajectoire, soulève la spatule avant de la neige et fais un tour complet sur toi-même en l\'air, c\'est-à-dire un 360.', 'Figure Butter'),
(28, 'Le Tail-Drag 360', 'Commence de la même manière que le Tail-Drag 180, mais là encore, pousse plus fort, en faisant glisser le talon de la planche jusqu\'à une position perpendiculaire, puis décolle-le de la neige pour effectuer une rotation complète à 360 degrés.', 'Figure Grabs'),
(29, 'Le Tail', 'Attrape le talon de ta planche avec ta main arrière (juste à l\'extrémité, pas sur les côtés).', 'Figure Grabs'),
(30, 'Le Weddle', 'Du nom de Chris Weddle, l\'inventeur, attrape le carre des orteils entre les fixations avec ta main avant.', 'Figure Grabs'),
(31, 'Le Nose', 'Attrape l\'extrémité avant de ta planche avec ta main avant.', 'Figure Grabs'),
(33, 'Encore un post 14', 'Encore un', 'Figure 1'),
(34, 'Encore un post 15', 'Encore un nouveau post', 'Figure 1'),
(40, 'Test5', 'Blabla', 'Figure 1'),
(41, 'Test6', 'Blabla', 'Figure 1'),
(42, 'Test7', 'bbb', 'Figure 1');

